import React from "react";

const DashboardAdmin = () => {
    const employees = [
        { id: 1, name: "John Doe", firstName: "John", lastName: "Doe", address: "123 Main St" },
        { id: 2, name: "Jane Smith", firstName: "Jane", lastName: "Smith", address: "456 Elm St" },
        // Add more employees here
    ];

    const clients = [
        { id: 1, name: "BNP", firstName: "John", lastName: "Doe", address: "123 Main St" },
        { id: 2, name: "MICROSOFT", firstName: "Jane", lastName: "Smith", address: "456 Elm St" },
        // Add more clients here
    ];

    return (
        <>
            <h1 className="text-black text-2xl text-center font-bold mb-4">Dashboard Admin</h1>
            <p className="text-black text-center">Vous êtes connecté en tant qu'administrateur</p>
            <table class="table-fixed">
  <thead>
    <tr>
      <th>Song</th>
      <th>Artist</th>
      <th>Year</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>The Sliding Mr. Bones (Next Stop, Pottersville)</td>
      <td>Malcolm Lockyer</td>
      <td>1961</td>
    </tr>
    <tr>
      <td>Witchy Woman</td>
      <td>The Eagles</td>
      <td>1972</td>
    </tr>
    <tr>
      <td>Shining Star</td>
      <td>Earth, Wind, and Fire</td>
      <td>1975</td>
    </tr>
  </tbody>
</table>
        </>
    );
};

export default DashboardAdmin;
